INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (1, 'interact', 'взаимодействовать', '["Our service is supposed to interact with customers."]');
INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (2, 'kernel', 'ядро, зерно, суть', '["The kernel of this whole idea is simplicity of user interaction.", "The nut finally cracks and exposes a rich, oily kernel."]');
INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (3, 'schedule', 'планировать, расписание', '["I scheduled our meetings on Fridays.", "My schedule is very dense today."]');
INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (4, 'attempt', 'попытка, предпринимать попытку', '["Your pitiful attempt at revolution has failed.", "I wasn''t sure so didn''t attempt anything."]');
INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (5, 'ensure', 'гарантировать, обеспечивать', '["We must ensure successful elections.", "We can''t ensure the safety of the hostages."]');
INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (6, 'permission', 'разрешение', '["I don''t really need your permission to do that."]');
INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (7, 'ad hoc', 'придуманный специально для этого, по необходимости', '["We deal with problems on an ad hoc basis (= as they happen).", "We have created ad hoc committees for this purpose.", "This ad hoc mechanism has not been effective in global scope."]');
INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (8, 'passion', 'страсть, азарт', '["Gambling is my passion.", "He has it all: speed, passion, team tactics.", "We had a short but passionate love affair."]');
INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (9, 'sane', 'здравый (человек, рассудок, решение, мысль)', '["I never claimed to be sane.", "That was a sane decision."]');
