INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (12, 'assume', 'предполагать, допускать, брать на себя (ответственность, роль)', '["I can assume two possible outcomes.", "You should assume leadership and responsibility."]');
INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (13, 'toil', 'усердно работать', '["You need to toil if you want to succeed."]');
