INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (891, 'keen', 'сильный (о чувствах или умениях), любезный, поспешный (в исполнении чего-либо)', '["She''s a keen tennis player.", "He''s got a keen sense of smell.", "She was very keen to help."]');
