INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (896, 'exert', 'задействовать (связи, черты, влияние)', '["If you were to exert your influence they might change their decision.", "Some managers exert considerable pressure on their staff to work extra hours."]');
INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (897, 'sultry', 'душный (о погоде), горячий (о сексуально привлекательном человеке)', '[]');
