INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (900, 'leverage', 'задействовать что-то, что ты имеешь, чтоб получить какую-либо выгоду', '["This new strategy is about leveraging the relationships we have with our customers.", "It should be possible to leverage your temporary assignment into a full-time job."]');
