INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (959, 'content', 'удовлетворение, удовлетворять, быть удовлетворенным, довольным чем-то', '["He seems fairly content with his life.", "My explanation seemed to content him."]');
