INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (961, 'sheer', 'выдающийся (о качествах и чувствах), отвесный (склон), чистый (неразбавленный) ', '["The suggestion is sheer nonsense.", "His success was due to sheer willpower/determination.", ""]');
