INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (964, 'shabby', 'потрепанный, поношенный, бесчестный', '["He wore a shabby old overcoat.", "Her home is in a shabby part of town.", "The company''s treatment of women was shabby."]');
INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (965, 'yield', 'произвести выгоду, уступить полномочия, уступить', '["Favourable weather yielded a good crop.", "They were forced to yield their land.", "If you''re going downhill, you need to yield to bikers going uphill."]');
INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (966, 'crop', 'урожай, поставка, выборка', '["The main crops grown for export are coffee and rice.", "The judges will select the best from this year''s crop of first novels."]');
INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (967, 'allege, allegation', 'бездоказательно утверждать, бездоказательное обвинение', '["The allegations of corruption were not true."]');
INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (968, 'oblige', 'обязать, удовлетворить просьбу', '["Circumstances obliged him to leave the town.", "We only went to the party to oblige some old friends who asked us to be there.", "We needed a guide and he was only too happy to oblige."]');
INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (969, 'mutilate', 'калечить, уродовать', '["Self-hatred apparently drove her to mutilate her own face."]');
INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (970, 'straggle', 'отставать', '["The players straggled in for the morning practice session.", "This host of course is not normal and shows straggling."]');
