INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (974, 'indulge', 'позволять себе что-то, возможно, сверх меры', '["We took a deliberate decision to indulge in a little nostalgia.", "The soccer fans indulged their patriotism, waving flags and singing songs.", "I love champagne but I don''t often indulge myself."]');
