INSERT INTO public.vocabulary (id, lang1, lang2, examples) VALUES (990, 'pledge', 'серьезное или формальное обещание, обещать', '["We are asking people to pledge their support for our campaign.", "Thousands of people made pledges to the charity campaign."]');
